import React from 'react';
import { Box, Typography } from "module";
import SkillData from './SkillData';



const Skills = () => {
    return (
        <>
            {SkillData.map((item, index) => {
                return (<><Box>
                    <Typography>{item.title}</Typography>
                </Box></>)
            })}
        </>
    )
}

export default Skills;
